import React from 'react';
import Balances from './Balances';
import './FinancialsPage.css'
import TransfersHeading from './TransfersHeading';
import TransfersTable from './TransfersTable';

const balancesData = [
    {
        name: "USDC",
        quantity: 11000,
        value: 11000
    },
    {
        name: "BTC",
        quantity: 11,
        value: 1234
    },
    {
        name: "ETH",
        quantity: 112.23,
        value: 12234
    },
    {
        name: "SAI",
        quantity: 11,
        value: 1234
    }
]

const FinancialsPage = (props) => {
    return (
        <div className="DI_FinancialsPage_main">
            <Balances balancesData={balancesData} />
            <div className="DI_FP_Transfers_Table_wrapper">
                <TransfersHeading />
                <div className="DI_FP_Transfers_Table_main">
                    <TransfersTable />
                </div>
            </div>
        </div>
    )
}

export default FinancialsPage;
